import React from 'react';
import {NavLink} from "react-router-dom";

const Menu = () => {
    return (
       <>
       <NavLink activeClassName="active_class" to="/">About  </NavLink>
       <NavLink to="/contact">Contact  </NavLink>
       <NavLink to="/service">Service  </NavLink>
       </>
    )
}

export default Menu
